#===================
# Problem 3-4c
#===================
# This function karatsuba_multiply takes in two integers (or longs)
# and multiplies them together using the Karatsuba
# Multiplication Algorithm.
#
# Remember to only use the Python "*" operator in the manner described above.

def karatsuba_multiply(x, y):
  larger = max(x, y)
  if larger < 10:
    return x * y
  n = len(str(larger))
  x_1 = x / (10 ** (n / 2))
  x_0 = x % (10 ** (n / 2))
  y_1 = y / (10 ** (n / 2))
  y_0 = y % (10 ** (n / 2))
  z_0 = karatsuba_multiply(x_0, y_0)
  z_2 = karatsuba_multiply(x_1, y_1)
  z_1 = karatsuba_multiply((x_0 + x_1), (y_0 + y_1))
  if (n % 2 == 1):
    return z_2 * (10 ** (n - 1)) + (z_1 - z_0 - z_2) * (10 ** (n / 2)) + z_0
  return z_2 * (10 ** n) + (z_1 - z_0 - z_2) * (10 ** (n / 2)) + z_0

